using System;
using System.IO;
using System.Windows.Controls;
using System.Windows.Media.Imaging;

namespace Applicant.Utilities
{
    public class Photo
    {
        public static BitmapImage BitmapPhoto { get; set; }
        public const string ApplicantImage = "";

        public static string LoadPhoto(string base64, Image PhotoImage)
        {
            byte[] binaryData = Convert.FromBase64String(base64);

            if (base64 == "")
            {
                byte[] binaryData2 = Convert.FromBase64String(ApplicantImage);
                BitmapPhoto = new BitmapImage();
                BitmapPhoto.BeginInit();
                BitmapPhoto.StreamSource = new MemoryStream(binaryData2);
                BitmapPhoto.EndInit();
                PhotoImage.Source = BitmapPhoto;
                return base64;
            }

            BitmapPhoto = new BitmapImage();
            BitmapPhoto.BeginInit();
            BitmapPhoto.StreamSource = new MemoryStream(binaryData);
            BitmapPhoto.EndInit();
            PhotoImage.Source = BitmapPhoto;
            return base64;
        }

        public static string AddPhoto(Image PhotoImage)
        {

            // Create OpenFileDialog 
            Microsoft.Win32.OpenFileDialog dlg = new Microsoft.Win32.OpenFileDialog();



            // Set filter for file extension and default file extension 
            dlg.DefaultExt = ".png";
            dlg.Filter = "JPEG Files (*.jpeg)|*.jpeg|PNG Files (*.png)|*.png|JPG Files (*.jpg)|*.jpg|GIF Files (*.gif)|*.gif";


            // Display OpenFileDialog by calling ShowDialog method 
            Nullable<bool> result = dlg.ShowDialog();


            // Get the selected file name and display in a TextBox 
            if (result == true)
            {
                // Open document 
                string filePath = dlg.FileName;
                byte[] imageArray = System.IO.File.ReadAllBytes(filePath);
                string base64ImageRepresentation = Convert.ToBase64String(imageArray);
                return base64ImageRepresentation;
            }
            return "";
        }
    }
}
